import React from 'react';
import { useNavigate, Link } from 'react-router-dom';

import landingbg from '../assets/landingbg.jpeg'
import rightLandingBG from '../assets/rightLandingBG.png'

const styles = {
    container: {
        display: 'flex',
        height: '100%',
    },
    left: {
        width: '50%',
        backgroundImage: `url(${leftLandingBG})`,
        cursor: 'pointer',
    },
    right: {
        width: '50%',
        backgroundImage: `url(${rightLandingBG})`,
        cursor: 'pointer',
    },
};

const LandingBG = () => {
    const history = useNavigate();

    const handleShopClick = () => {
        history.push('/shop');
    };

    const handleAboutClick = () => {
        history.push('/about');
    };

    return (
        <div className="background">
          <div className="left">
            <Link to="/shop">
            </Link>
          </div>
          <div className="right">
            {/* Right side content goes here */}
          </div>
        </div>
      );
}


export default LandingBG;
